import React, { Component } from "react";
import { Button } from 'react-bootstrap';
import {withRouter} from 'react-router-dom';
import Checkbox from '../Checkbox/Checkbox'; 
import { CSSTransitionGroup } from 'react-transition-group';



// create an Object directly 
// const consents = 
//   {
//     'checkBox1': 'I have read the information above, and understand what the study involves',

//     'checkBox2': 'I understand that my anonymised personal data can be shared with others for future research, shared in public databases and in scientific reports.',

//     'checkBox3': 'I understand that I am free to withdraw from this study at any time without giving a reason and this will not affect my future medical care or legal rights.',

//     'checkBox4': 'I understand the potential benefits and risks of participating, the support available to me should I become distressed during the research, and who to contact if I wish to lodge a complaint.',

//     'checkBox5': 'I understand the inclusion and exclusion criteria in the Information Sheet and as explained to me by the researcher.  I confirm that I do not fall under the exclusion criteria.',

//     'checkBox6': 'I agree that the research project named above has been explained to me to my satisfaction and I agree to take part in this study.',
// }; 


const checkboxes = [
  {
    content: 'I have read the information above, and understand what the study involves',
    type: 'checkBox1',
  },
  {
    type: 'checkBox2',
    content: 'I understand that my anonymised personal data can be shared with others for future research, shared in public databases and in scientific reports.',
  },

  {
    type: 'checkBox3',
    content: 'I understand that I am free to withdraw from this study at any time without giving a reason and this will not affect my future medical care or legal rights.',
  },
  {
    type: 'checkBox4',
    content: 'I understand the potential benefits and risks of participating, the support available to me should I become distressed during the research, and who to contact if I wish to lodge a complaint.',
  },
  {
    type: 'checkBox5',
    content: 'I understand the inclusion and exclusion criteria in the Information Sheet and as explained to me by the researcher.  I confirm that I do not fall under the exclusion criteria.',
},
  {
    type: 'checkBox6',
    content: 'I agree that the research project named above has been explained to me to my satisfaction and I agree to take part in this study.',
  },
];


console.log(consents)

class Consent extends Component {
  constructor(props) {
    super(props);

    const prolific_id = this.props.location.state.prolific_id
    const study_id    = this.props.location.state.study_id
    const longit_id   = this.props.location.state.longit_id

    var options = {}
    var answers = {}

  for (var key in consents) {
    console.log(key)
    options[consents[key]] = false 
    // answers[consents[key]] = consents[key] // might be u
  }

  console.log(options)
  console.log(answers)

  this.state = {
    checkboxes: options,
    prolific_id: prolific_id, 
    study_id : study_id,
    longit_id: longit_id,
  };

  console.log(this.state.checkboxes)

  this.handleSubmit       = this.handleSubmit.bind(this);  
  this.createCheckBox     = this.createCheckBox.bind(this); 

//   this.redirectToTarget.bind(this);
}


  handleCheckboxChange = changeEvent => {
    const { name } = changeEvent.target;

    console.log(name)

    this.setState(prevState => ({
      checkboxes: {
        ...prevState.checkboxes,
        [name]: !prevState.checkboxes[name],
      }
    }));


  };


// redirectToTarget = () => {
//   this.props.history.push({
//     pathname: `/Survey`, 
//     state: {participant_info: this.state} 
//   })
// }


handleSubmit(event) {

        // console.log(event)

        event.preventDefault();

        // Check if all of the boxes are checked -> redirect to Survey, otherwise POP--UP window: do you want to leave the study?  
        // console.log(this.state.checkboxes)
        const options   = this.state.checkboxes
        // const answers   = this.state.answers
        const box_total = Object.keys(options).length

        const sumValues = obj => Object.values(obj).reduce((a, b) => a + b);
        const count = sumValues(this.state.checkboxes);
        console.log('Number of checked boxes:',count)

        // sub select only answer options that have been checked 

        if (count < box_total){ // at least one box is checked
            // pop-up window or redirect external to prolific 
          }

        else if (count===box_total) {
          // redirect to survey here - maybe with the timeout  
          this.props.history.push({
            pathname: `/Survey`, 
            state: {participant_info: this.state} 
          })
        }
        else {

        }
      }



handleCheckboxChange(changeEvent,e) {
  console.log('ChangeEvent',changeEvent)

  this.setState(prevState => ({
      checkboxes: {
        ...prevState.checkboxes,
        [changeEvent]: !prevState.checkboxes[changeEvent],
      }
    }));
}

createCheckBox(key) {
    return (
      <Checkbox
        label           ={key.content}
        type            ={key.type}
        isSelected      ={this.state.checkboxes[key]}
        onCheckboxChange={(e)=>this.handleCheckboxChange(key.type,e)}
      />
    );
  }



  render() {
    return (
    <CSSTransitionGroup
      className="container"
      component="div"
      transitionName="fade"
      transitionEnterTimeout={800}
      transitionLeaveTimeout={500}
      transitionAppear
      transitionAppearTimeout={500}
    >

        <div className="answerOptions">
          {consents.map(this.createCheckBox)}
        </div>

      <p></p>
      <div className="col-md-12 pad-20">
        <div>
          <button type="button" className="btn btn-save btn-primary pad-20" onClick={this.handleSubmit}>
            Submit
          </button>
          </div>
      </div>

    </CSSTransitionGroup>
  );
  }


}

/*
<form onSubmit={this.handleFormSubmit}>
              {this.createCheckboxes()}
            </form>


*/

export default withRouter(Consent);
